package it.csi.epay.epaypaweb.test;

import java.io.ByteArrayInputStream;
import java.util.Base64;

import javax.xml.bind.JAXBContext;
import javax.xml.bind.JAXBElement;
import javax.xml.bind.JAXBException;
import javax.xml.bind.Unmarshaller;
import javax.xml.stream.XMLInputFactory;
import javax.xml.stream.XMLStreamException;
import javax.xml.stream.XMLStreamReader;
import javax.xml.transform.stream.StreamSource;

import org.junit.Assert;
import org.junit.Test;

import it.csi.epay.epaypaweb.facade.rendicontazione.dto.gov.CtFlussoRiversamento;

public class UnmarshalBase64 {
	@SuppressWarnings("unchecked")
	private <T> T unmarshalFromBase64(byte[] input, Class<?> objectFlactoryClass, Class<T> unmarshalledObjClass) throws XMLStreamException, JAXBException {
        JAXBContext jc = JAXBContext.newInstance(objectFlactoryClass);

        XMLInputFactory xif = XMLInputFactory.newFactory();

        XMLStreamReader xsr = xif.createXMLStreamReader(new StreamSource(new ByteArrayInputStream(Base64.getDecoder().decode(input))));

        Unmarshaller unmarshaller = jc.createUnmarshaller();

        return ((JAXBElement<T>)unmarshaller.unmarshal(xsr)).getValue();
	}

	@Test
	public void testUnmarshalling() {
		String base64="";

		try {
			CtFlussoRiversamento flusso = unmarshalFromBase64(base64.getBytes(), it.csi.epay.epaypaweb.facade.rendicontazione.dto.gov.ObjectFactory.class, CtFlussoRiversamento.class);
			System.out.println(flusso.getIdentificativoFlusso());

		} catch (Exception e) {
			e.printStackTrace();
			Assert.fail();
		}
	}

}
